import Time from "react-time";
import {
  Container,
  Row,
  Col,
  Alert,
  Breadcrumb,
  BreadcrumbItem,
  Card,
  CardHeader,
  CardTitle,
  CardImg,
  CardBody,
  CardFooter,
  Button
} from "shards-react";
import Moment from "react-moment";

let now = new Date();

const SystemInfo = props => (
  <div>
    <Row>
      <Col sm={3} md={3} lg={3} xl={3}></Col>
      <Col sm={3} md={3} lg={3} xl={3}></Col>
      <Col sm={3} md={3} lg={3} xl={3}>
        <Moment interval={0}>{now}</Moment>
      </Col>
      <Col sm={3} md={3} lg={3} xl={3}>
        <Time value={now} format="DD/MM/YYYY" />
      </Col>
    </Row>
  </div>
);

export default SystemInfo;
